import React from 'react';
import heroimg from '../src/Images/heroimg.png';
const ContactL=()=>{
    return(
        <>
       <div className='container-fluid'>
           <div className='row'>
                <div className='heroimg'>
                    <img src={heroimg}/>
                </div>
           </div>
       </div>
        </>
    );
};
export default ContactL;
